import React from 'react';
import Spline from '@splinetool/react-spline';
import './App.css';

function Home() {
  return (
    <div className="min-h-screen flex items-center justify-center bg-black">
      <div className="flex items-center justify-between w-full max-w-7xl px-6">
        {/* Left Section - Text and Button */}
        <div className="text-white space-y-6 max-w-md">
          <h1 className="text-6xl font-bold">FocusWin</h1>
          <p className="text-2xl">Turn Every Task into a Win.</p>
          <p className="text-lg">
            Because you're not just checking boxes — you're leveling up. FocusFirst is your quest log.
          </p>
          <button className="bg-transparent border-2 border-green-400 text-green-400 px-6 py-2 rounded-full hover:bg-green-400 hover:text-black transition duration-300 flex items-center">
            Get Started <span className="ml-2">→</span>
          </button>
        </div>

        {/* Right Section - Spline 3D Model */}
        <div className="w-1/2 flex justify-end">
          <Spline scene="https://prod.spline.design/jMvj2LqNqyfm4frr/scene.splinecode" />
        </div>
      </div>
    </div>
  );
}

export default Home;
